import React from 'react';
import classes from './Profile.module.css'




const Profile = () => {

	return (
		<div className={classes.Profile}>
			<div className={classes.header}>
       <h1 className={classes.title}>My profile лох</h1>
			</div>
			

		</div>
	)
}


export default Profile;
